import './App.css';
import Hub from "./component/Hub"
function App() {
  return (
    <>
    <Routes>
      <Route path = '/' element = {<Hub/>}/>
      <Route path = '/Homepage1' element = {<Homepage1/>}/>
      <Route path = '/Homepage2' element = {<Homepage2/>}/>
    </Routes>
    </>
  );
}

export default App;
